import './HealthRecords.css';
import Navbar from './Navbar';

export default function HealthRecords({ role }) {
    return (
        <div className="container">
            <Navbar role={role} />
            <h1>Health Records</h1>
            <p>Here you can view and manage your health records.</p>
        </div>
    )
}
